description:
The year is 2029. The world has become intensively information oriented and humans are well-connected to the network.
Crime has developed into a sophisticated stage by hacking into the interactive network.
To prevent this, Section 9 is formed. These are cyborgs with incredible strengths and abilities that can access any network on Earth

